DROP TABLE IF EXISTS `COUNTRY`;
CREATE TABLE `COUNTRY` (
  `LETTER_CODE2` varchar(2) NOT NULL COMMENT '二位字母代码',
  `LETTER_CODE3` varchar(3) NOT NULL COMMENT '三位字母代码',
  `NAME` varchar(80) NOT NULL COMMENT '英文名',
  `CHINESE_NAME` varchar(80) NOT NULL COMMENT '中文名称',
  `NUMERIC_CODE` varchar(3) NOT NULL COMMENT '三位数字代码',
  `AREA_CODE` varchar(5) NOT NULL COMMENT '国际电话区号',
  PRIMARY KEY (`LETTER_CODE2`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='国家表';

