DROP TABLE IF EXISTS `REGION`;
CREATE TABLE `REGION` (
  `ID` int(11) NOT NULL COMMENT 'id',
  `PARENT_ID` int(11) NOT NULL COMMENT '父级id',
  `LEVEL` int(11) NOT NULL COMMENT '地区等级(0:国家;1:省;2:市;3:区/县;)',
  `NAME` varchar(30) NOT NULL COMMENT '名称',
  `CITY_CODE` varchar(10) NOT NULL DEFAULT '' COMMENT '城市编码',
  `POSTAL_CODE` varchar(10) NOT NULL DEFAULT '' COMMENT '邮政编码',
  `SHORT_NAME` varchar(20) NOT NULL COMMENT '简称',
  `FULL_NAME` varchar(100) NOT NULL COMMENT '全称',
  `ENGLISH_NAME` varchar(30) NOT NULL COMMENT '英文名称',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区表';

